import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/SidebarStyles.css';

function Sidebar() {
  return (
    <div className="sidebar">
      <div className="form-page">
        <Link>Form</Link>
      </div>
      <div className="table-page">
        <Link>Table</Link>
      </div>
    </div>
  );
}

export default Sidebar;
